import React, { Component } from 'react'
import PropTypes from 'prop-types'
import Link from 'next/link'

export default class extends Component {
  constructor (props) {
    super(props);
    this.state = {
        ...this.props,
    };
  }

  componentDidMount() {
    const Fingerprint2 = require('fingerprintjs2');

    Fingerprint2.get((result)=> {
        console.log(result)
    });
  }

  render() {
      return(
        <div>
        <h2>Title</h2>
        <p>Something descriptive...</p>
        <Link href={{ pathname: 'question', query: { q: 1 }}} as="/question/1">
            <button>Start</button>
        </Link>
        </div>
      );
  }
}
